    /**
     * @return string
     * @throws \Exception
     */
    public static function getUserAgent(): string
    {
        if (!self::$userAgents) {
            throw new \Exception('User agents list is empty');
        }

        return self::$userAgents[array_rand(self::$userAgents)];
    }


    /**
     * @return array<string>
     */
    public static function getUserAgents(): array
    {
        return self::$userAgents;
    }


    /**
     * @param array<string> $userAgents
     *
     * @return void
     */
    public static function setUserAgents(array $userAgents): void
    {
        self::$userAgents = $userAgents;
    }
